description:
I was bored, so I decided to do something similar to unforgettable.dk's zip bomb, only much stronger: 
I made a single 4 GB file, compressed it, copied it 16 times into a single archive, then copied the archive 16 times, compressed that, etc... with the exception of one of the later levels, where I decided to go crazy and copy it 1,000 times instead of 16. In total, there are 23 nested levels of compression in the hierarchy (including the first and last). 

This was just meant for fun; idk why I did it. 
